// OrganizationRoleType: Полномочия организации: CU - Заказчик; RA - Уполномоченный орган; AI - Уполномоченное учреждение; SO - Специализированная организация, осуществляющая закупки в соответствии с Федеральным законом № 44-ФЗ и (или) Постановлением № 615; CO - Контрольный орган в сфере закупок; SP - Юридическое лицо, оказывающее услуги по обслуживанию пользователей единой информационной системы; FO - Финансовый орган; EO - Оператор электронной площадки; AA - Орган аудита в сфере закупок; CA - Орган по регулированию контрактной системы в сфере закупок; NA - Орган, размещающий правила нормирования; DA - Орган, устанавливающий требования к отдельным видам товаров, работ, услуг и (или) нормативные затраты; BA - Гарант, выдающий независимые гарантии; TA - Орган, разрабатывающий и утверждающий типовые контракты и типовые условия контрактов (устарело, не применяется); OA - Организация, осуществляющая полномочия заказчика на основании соглашения в соответствии с частью 6 статьи 15 Федерального закона № 44-ФЗ; CIA - Орган (за исключением контрольного органа в сфере закупок), уполномоченный на осуществление контроля (проверки) информации и документов, подлежащих контролю (проверке) в соответствии с законодательством Российской Федерации о контрактной системе в сфере закупок товаров, работ, услуг для обеспечения государственных и муниципальных нужд, бюджетным законодательством Российской Федерации; ICB - Орган внутреннего государственного (муниципального) финансового контроля; NP - Орган, уполномоченный на ведение реестра недобросовестных подрядных организаций в соответствии с Постановлением № 615; GR - Главный распорядитель бюджетных средств; OV - Орган государственной (исполнительной) власти; CS - Организация, осуществляющая закупки в соответствии с частью 5 статьи 15 Федерального закона № 44-ФЗ; CC - Заказчик по Федеральному закону 223-ФЗ, осуществляющий закупки в соответствии с Федеральным законом № 44-ФЗ, в случаях, предусмотренных Федеральным законом № 223-ФЗ; AU - Юридическое лицо, осуществляющее закупку в соответствии с частью 4 статьи 5 Федерального закона от 30.12.2008 № 307-ФЗ «Об аудиторской деятельности»; IS - Оператор региональной информационной системы в сфере закупок; BT - Орган, уполномоченный на ведение библиотеки типовых условий контрактов; MP - Орган, осуществляющий мониторинг закупок; MC - Организация, осуществляющая мониторинг соответствия в соответствии с Федеральным законом № 223–ФЗ; AC - Организация, осуществляющая оценку соответствия в соответствии с Федеральным законом № 223–ФЗ. TRU - Орган, уполномоченный на формирование и ведение каталога товаров, работ, услуг для обеспечения государственных и муниципальных нужд; OKT - Оператор каталога товаров, работ, услуг для обеспечения государственных и муниципальных нужд (устарело, не применяется); TC - Орган местного самоуправления и (или) государственное, муниципальное бюджетное, казенное учреждение в случаях, предусмотренных частью 4 статьи 182 Жилищного кодекса Российской Федерации, осуществляющее функции технического заказчика в соответствии с Постановлением № 615; RPO - Орган, уполномоченный на ведение реестра квалифицированных подрядных организаций в соответствии с Постановлением № 615; RD - Орган, уполномоченный на ведение реестра договоров об оказании услуг и (или) выполнении работ по капитальному ремонту общего имущества в многоквартирном доме в соответствии с Постановлением № 615; REP - Организация, размещающая информацию и документы в реестре единственных поставщиков товара, производство которого создается, модернизируется, осваивается, единственных исполнителей услуги, оказываемой с использованием имущества, которое создается, реконструируется, в соответствии со статьями 111.3, 111.4 Федерального закона № 44-ФЗ; PIK - Организация, размещающая отчет о количестве товара и (или) объеме услуги, произведенного и (или) оказанной поставщиком (исполнителем), с которым заключен контракт в соответствии со статьями 111.3, 111.4 Федерального закона № 44-ФЗ; RO - Специализированная некоммерческая организация, которая осуществляет деятельность, направленную на обеспечение проведения капитального ремонта общего имущества в многоквартирных домах в соответствии с Постановлением № 615 (региональный оператор); OTR - Федеральный орган исполнительной власти, уполномоченный на формирование сведений каталога товаров, работ, услуг; TKO - Региональный оператор по обращению с твердыми коммунальными отходами, осуществляющий закупки в соответствии с Постановлением № 1133; CN - Организация, осуществляющая закупки в соответствии с частью 4.1 или 4.3 статьи 15 Федерального закона N 44-ФЗ; SR ­ Преемник прав и обязанностей организации, ранее размещавшей информацию и документы в ЕИС; VHI - Организация, имеющая доступ к информации и документам, не размещаемым на официальном сайте ЕИС в сфере закупок; SV - Орган (организация), имеющая доступ к информации о признаках и рисках нарушений; MZ - Орган (организация), имеющая доступ к аналитической информации; CLA Организация, уполномоченная на ведение бюджетного/ бухгалтерского учета в соответствии с п. 6 ст. 264.1 БК РФ или иная централизованная бухгалтерия; OS - Оператор информационной системы, имеющей доступ к сервисам; PE - Исполнитель проекта - федеральный орган исполнительной власти или группа по реализации проекта в соответствии с Постановлением № 43
